import React, { useState, useEffect } from 'react';
import {
    Container,
    Typography,
    CircularProgress,
    Box,
    Card,
    CardContent,
    Button,
    FormControl,
    Select,
    MenuItem,
    InputLabel,
    Alert,
} from '@mui/material';

function Homepage() {
    const [locations, setLocations] = useState([]);
    const [selectedLocation, setSelectedLocation] = useState('');
    const [predictions, setPredictions] = useState([]);
    const [loading, setLoading] = useState(false);
    const [accidentWarnings, setAccidentWarnings] = useState([]);
    const [rainfallWarnings, setRainfallWarnings] = useState([]);

    useEffect(() => {
        fetch("http://127.0.0.1:8000/locations")
            .then(response => response.json())
            .then(data => setLocations(data))
            .catch(error => console.error("Error fetching locations:", error));
    }, []);

    const handlePredictWeek = () => {
        setLoading(true);
        fetch(`http://127.0.0.1:8000/predict_week`, {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ location: selectedLocation }),
        })
            .then(response => {
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                return response.json();
            })
            .then(data => {
                const accidentWarningsList = [];
                const rainfallWarningsList = [];

                // Process predictions for each day
                const processedPredictions = data.map(day => {
                    let adjustedAccidents = day.total_accidents;
                    if (day.rainfall > 70) {
                        adjustedAccidents += 2; // Add 2 if rainfall > 70
                        rainfallWarningsList.push('High rainfall expected, take precautions!');
                    } else if (day.rainfall > 65) {
                        adjustedAccidents += 1; // Add 1 if rainfall > 65
                    }
                    accidentWarningsList.push(adjustedAccidents > 2 ? 'High accident risk due to weather conditions!' : '');

                    return { ...day, total_accidents: adjustedAccidents };
                });

                setPredictions(processedPredictions);
                setAccidentWarnings(accidentWarningsList);
                setRainfallWarnings(rainfallWarningsList);
                setLoading(false);
            })
            .catch(error => {
                console.error("Error fetching prediction:", error);
                setLoading(false);
            });
    };

    return (
        <Container
            maxWidth="md"
            style={{
                padding: "20px",
                backgroundColor: "transparent",
            }}
        >
            <Typography
                variant="h4"
                align="center"
                gutterBottom
                style={{ color: "#00796b", fontWeight: "bold" }}
            >
                Weather Prediction
            </Typography>

            <Card variant="outlined">
                <CardContent>
                    <FormControl fullWidth variant="outlined" style={{ marginBottom: "20px" }}>
                        <InputLabel>Select Location</InputLabel>
                        <Select
                            value={selectedLocation}
                            onChange={e => setSelectedLocation(e.target.value)}
                            label="Select Location"
                        >
                            <MenuItem value="">
                                <em>Select Location</em>
                            </MenuItem>
                            {locations.map((location, index) => (
                                <MenuItem key={index} value={location}>{location}</MenuItem>
                            ))}
                        </Select>
                    </FormControl>
                    <Button
                        variant="contained"
                        color="primary"
                        onClick={handlePredictWeek}
                        disabled={!selectedLocation || loading}
                    >
                        {loading ? <CircularProgress size={24} /> : 'Get Weekly Prediction'}
                    </Button>

                    {predictions.length > 0 && (
                        <Box mt={4}>
                            <Typography variant="h5" align="center">
                                Weekly Predictions for {selectedLocation}
                            </Typography>
                            {predictions.map((day, index) => (
                                <Box key={index} mt={2}>
                                    <Typography variant="h6">Day {index + 1}</Typography>
                                    <Typography variant="body1">Min Temperature: {day.min_temp} °C</Typography>
                                    <Typography variant="body1">Max Temperature: {day.max_temp} °C</Typography>
                                    <Typography variant="body1">Humidity 9AM: {day.humidity_9am} %</Typography>
                                    <Typography variant="body1">Humidity 3PM: {day.humidity_3pm} %</Typography>
                                    <Typography variant="body1">Wind Speed 9AM: {day.wind_speed_9am} km/h</Typography>
                                    <Typography variant="body1">Wind Speed 3PM: {day.wind_speed_3pm} km/h</Typography>
                                    <Typography variant="body1">Predicted Rainfall: {day.rainfall} mm</Typography>
                                    <Typography variant="body1">Total Accidents Predicted: {day.total_accidents}</Typography>
                                </Box>
                            ))}
                        </Box>
                    )}

                    {accidentWarnings.length > 0 && accidentWarnings.map((warning, index) => (
                        warning && <Alert key={index} severity="warning" style={{ marginTop: '20px' }}>{warning}</Alert>
                    ))}

                    {rainfallWarnings.length > 0 && rainfallWarnings.map((warning, index) => (
                        warning && <Alert key={index} severity="warning" style={{ marginTop: '20px' }}>{warning}</Alert>
                    ))}
                </CardContent>
            </Card>
        </Container>
    );
}

export default Homepage;
